//@flow

import React from 'react';
import { View, Image } from 'react-native';
// import defaultImg from '../images/_assets/default.jpg';

type Props = {
  type: 'normal' | 'large',
  src: string,
  style: any
}

const RoundedImage = (props: Props) => {
  const size = props.type === 'normal' ? 50 : 80;
 console.log(props)
  return (
    <View style={props.style}>
      <Image style={[{
        borderWidth:1,
        borderColor:'rgba(0,0,0,0.2)',
        // alignContent: 'center',
        // alignItems:'center',
        // justifyContent:'center',
        width: size,
        height: size,
        backgroundColor:'#333',
        borderRadius:100,
        marginBottom: 10,
        }]}
        source={ {uri: props.src} } 
      />
    </View>
  );
}

RoundedImage.defaultProps = {
  type: 'normal',
  style: {},
  src: "data:image/jpeg;base64,"
}

export default RoundedImage;